import Button from '@material-ui/core/Button';
import {useState} from 'react';
import React from 'react';
import FormDialog from '../confirmEmail/component/FormDialog';



export default function ComfirmEmail() {
      
      const  emailStorage = sessionStorage.getItem('emailValidator');
      

        async function onSub(e){

          const data = {
            email: emailStorage,
          }
        e.preventDefault();
         console.log(">>>data:",data);
        
 }

return (
  <form onSubmit={onSub}>
    <div>
    <h2 className='subtitle'>Quase lá,
       por Favor, confirme seu e-mail para
       enviarmos as instruções de validação.
      O link para validação será enviado para: {emailStorage}</h2>
    </div>
      
      <Clock/>
      <FormDialog>Editar</FormDialog>
    </form>
);
}
